const Title = (props) => {
  console.log(props)
  return (
    <h1>{props.text}</h1>
  )
}

const Button = (props) => {
  console.log(props)
  return (
    <button onClick = {props.handClick}>
      {props.text}
    </button>
  )
}

const Heading = (props) => {
  console.log(props)
  return (
      <h2>{props.text}</h2>
    )
}

const Statisctic = (props) => {
  return (
    <p></p>
  )
}

const App = () => {
  const [good, SetGood] = useState(0)
  const [neutral, SetNeutral] = useState(0)
  const [bad, SetBad] = useState(0)

  const handleGoodClick = () => {
    SetGood(good + 1)
  }


  return (
    <div>
      <Title text = 'Please provide feedback'/>
      <Button text = 'Good' handClick = {handleGoodClick} />
      <Button text = 'Neutral'/>
      <Button text = 'Bad'/>
      <Heading text = 'Statistics'/>
    </div>

  )
}

export default App;
